(SELECT "Isolation_Tree_0".join_key_0 AS join_key_0, "Isolation_Tree_0"."AnomalyScore_0" AS "AnomalyScore_0", "Isolation_Tree_1".join_key_1 AS join_key_1, "Isolation_Tree_1"."AnomalyScore_1" AS "AnomalyScore_1", "Isolation_Tree_2".join_key_2 AS join_key_2, "Isolation_Tree_2"."AnomalyScore_2" AS "AnomalyScore_2", "Isolation_Tree_3".join_key_3 AS join_key_3, "Isolation_Tree_3"."AnomalyScore_3" AS "AnomalyScore_3", "Isolation_Tree_4".join_key_4 AS join_key_4, "Isolation_Tree_4"."AnomalyScore_4" AS "AnomalyScore_4", "Isolation_Tree_5".join_key_5 AS join_key_5, "Isolation_Tree_5"."AnomalyScore_5" AS "AnomalyScore_5" 
FROM "Isolation_Tree_0" LEFT OUTER JOIN "Isolation_Tree_1" ON "Isolation_Tree_0".join_key_0 = "Isolation_Tree_1".join_key_1 LEFT OUTER JOIN "Isolation_Tree_2" ON "Isolation_Tree_2".join_key_2 = "Isolation_Tree_1".join_key_1 LEFT OUTER JOIN "Isolation_Tree_3" ON "Isolation_Tree_3".join_key_3 = "Isolation_Tree_2".join_key_2 LEFT OUTER JOIN "Isolation_Tree_4" ON "Isolation_Tree_4".join_key_4 = "Isolation_Tree_3".join_key_3 LEFT OUTER JOIN "Isolation_Tree_5" ON "Isolation_Tree_5".join_key_5 = "Isolation_Tree_4".join_key_4), 
"Isolation_AVG_Scores" AS 
(SELECT "Isolation_Join_CTE".join_key_0 AS "KEY", CAST("Isolation_Join_CTE"."AnomalyScore_0" AS FLOAT) / 6 + CAST("Isolation_Join_CTE"."AnomalyScore_1" AS FLOAT) / 6 + CAST("Isolation_Join_CTE"."AnomalyScore_2" AS FLOAT) / 6 + CAST("Isolation_Join_CTE"."AnomalyScore_3" AS FLOAT) / 6 + CAST("Isolation_Join_CTE"."AnomalyScore_4" AS FLOAT) / 6 + CAST("Isolation_Join_CTE"."AnomalyScore_5" AS FLOAT) / 6 AS "AnomalyScore" 
FROM "Isolation_Join_CTE")
 SELECT "Isolation_AVG_Scores"."KEY" AS "KEY", "Isolation_AVG_Scores"."AnomalyScore" AS "AnomalyScore", CASE WHEN ("Isolation_AVG_Scores"."AnomalyScore" <= 0.00737316248485) THEN 1 ELSE -1 END AS "OutlierIndicator" 
FROM "Isolation_AVG_Scores"